INSERT INTO `Email` VALUES (1,'2023-04-24 17:08:45',14,'The Daily Roar is here!','&lt;p&gt;Ladies and gentlemen,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Coders and codettes! The greatest innovation since the printing press has been born! &lt;strong&gt;On April 26th, 2023 from 4:30-6:30pm, come to &lt;/strong&gt;&lt;a href=&quot;https://www.kean.edu/research-days&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;Kean University&#039;s Research Day&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; at LHAC Exhibition to see the Daily Roar system.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Everyone knows that students rarely read their emails... yes, your professors know this, and they weren&#039;t born yesterday! More often than any of us would like, big opportunities for research, job interviews and campus events are lost in the Inbox graveyard. With the Daily Roar, you&#039;ll &lt;em&gt;never&lt;/em&gt; have to worry about missing an important email again. All CS and IT department emails will now come from one source, so you can finally stop searching for multiple names in your Gmail search bar.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Don&#039;t believe us? &lt;em&gt;Come and see for yourself!&lt;/em&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The amazing graduate students behind this innovative system, Pankati Patel, Alex Fisher, Uko Ebreso, Nicholas Moffa, and Kevin Parra-Olmedo, will be showcasing the functionality of the Daily Roar system at Kean University&#039;s Research Day. Don&#039;t miss out on the coolest event of the year! Be there or be NULL!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;em style=&quot;color: rgb(136, 136, 136);&quot;&gt;Sent from the Daily Roar System&lt;/em&gt;&lt;/p&gt;',0,0,395),(2,'2023-04-24 18:11:33',14,'[Important] Notice For Research Days','&lt;p&gt;On April 26th, 2023 from 4:30-6:30pm, come to Kean University&#039;s &lt;a href=&quot;https://www.kean.edu/research-days&quot; target=&quot;_blank&quot;&gt;Research Day&lt;/a&gt; at LHAC Exhibition Hall to see the Daily Roar system.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This new software system built by Kean University graduate students sends mass emails about job offers and events that make messages easier for students to read!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Be the 1, don&#039;t be the 0!&lt;/p&gt;',0,0,366),(3,'2023-04-25 17:57:33',18,'The Daily Roar is Here!','&lt;p&gt;Good Afternoon Fellow Students,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tomorrow, On April 26th, 2023 from 4:30-6:30pm, come to Kean University&#039;s&amp;nbsp;&lt;a href=&quot;https://www.kean.edu/research-days&quot; target=&quot;_blank&quot;&gt;Research Day&lt;/a&gt;&amp;nbsp;at LHAC Exhibition Hall to see the Daily Roar system.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This new software system built by Kean University graduate students sends mass emails about job offers and events that make messages easier for students to read!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To NULL or not to NULL? That is the Query!&lt;/p&gt;',0,0,366),(4,'2023-04-25 19:35:24',14,'[TOMORROW] RSVP For Pizza and Senior Showcase ','&lt;p&gt;&lt;strong style=&quot;color: rgb(34, 34, 34);&quot;&gt;Technology Senior Showcase&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Join us on&amp;nbsp;&lt;strong&gt;Wednesday, April 26th from 3 p.m. - 5 p.m.&amp;nbsp;&lt;/strong&gt;for our 9th annual Senior Showcase!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Come see and support all of our amazing and innovative seniors, as they showcase their capstone projects and much more! RSVP to the event no later than April 25nd using the link&amp;nbsp;below:&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/kgeCnrBnpGtYJTXA8&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;RSVP HERE TO ATTEND &amp;amp;&amp;nbsp;PIZZA&amp;nbsp;&lt;/a&gt;&lt;/p&gt;',0,0,17),(5,'2023-04-25 19:40:35',14,'[TOMORROW] RSVP FOR PIZZA AND SENIOR SHOWCASE','&lt;p&gt;Don&#039;t Forget! &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot; style=&quot;color: rgb(102, 163, 224);&quot;&gt;Our annual department Technology Senior Showcase is tomorrow! &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Join us on&amp;nbsp;&lt;strong&gt;Wednesday, April 26th from 3 p.m. - 5 p.m.&amp;nbsp;&lt;/strong&gt;for our 9th annual Senior Showcase!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Come see and support all of our amazing and innovative &lt;strong&gt;&lt;em&gt;seniors&lt;/em&gt;&lt;/strong&gt;, as they showcase their capstone projects and much more! RSVP to the event no later than April 25nd using the link&amp;nbsp;below:&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/kgeCnrBnpGtYJTXA8&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;RSVP HERE TO ATTEND &amp;amp;&amp;nbsp;PIZZA&amp;nbsp;&lt;/a&gt;&lt;/p&gt;',0,0,744),(6,'2023-04-25 20:52:16',14,'Student Feedback on Daily Roar System [Survey]','&lt;p&gt;Hello Students,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Below is a survey regarding feedback on the emails you have been receiving from this system. Your input is heavily valued and greatly appreciated.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/ZXWTHHfT5Q3KwXC29&quot; target=&quot;_blank&quot;&gt;SURVEY CLICK HERE&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sincerely,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The Daily Roar Team&lt;/p&gt;',0,0,395),(7,'2023-04-25 20:55:55',14,'Student Feedback on Daily Roar System [Survey]','&lt;p&gt;Hello Students,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Below is a survey regarding feedback on the emails you have been receiving from this system. Your input is heavily valued and greatly appreciated.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/EW9rAba5yXt8S3Vh9&quot; target=&quot;_blank&quot;&gt;SURVEY CLICK HERE&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sincerely,&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The Daily Roar Team&lt;/p&gt;',0,0,366),(8,'2023-04-26 14:53:30',14,'Today&#039;s the Day! Senior Showcase,Grad Cords and Resume Reviews! Oh Yeah, did we mention Pizza! ','&lt;p&gt;&lt;span class=&quot;ql-size-large&quot;&gt;HAPPENING TODAY! &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot; style=&quot;color: rgb(107, 36, 178);&quot;&gt;Technology Senior Showcase&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Join us today, &lt;strong&gt;Wednesday, April 26th from 3 p.m. - 5 p.m.&amp;nbsp;&lt;/strong&gt;for our 9th annual Senior Showcase!&lt;/p&gt;&lt;p&gt;Come see and support all of our amazing and innovative seniors, as they showcase their capstone projects and much more! RSVP using the link&amp;nbsp;below:&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/kgeCnrBnpGtYJTXA8&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;RSVP HERE TO ATTEND &amp;amp;&amp;nbsp;PIZZA&amp;nbsp;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;At showcase, we will be providing resume reviews! Must bring a paper copy of your resume to be reviewed, no exceptions! &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;It&#039;s that time!&lt;/strong&gt;&lt;span class=&quot;ql-size-large&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Time for&lt;strong&gt; Graduation&amp;nbsp;Cords&amp;nbsp;for Graduating Seniors&lt;/strong&gt;! &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;All graduating CS/IT students will receive (1)&amp;nbsp;cord&amp;nbsp;for graduation.&amp;nbsp;IF you participated in any other CS/IT student opportunity,&amp;nbsp;you may be eligible for another&amp;nbsp;cord&amp;nbsp;for your participation.&amp;nbsp;&lt;u&gt;Please note, all additional participation will need to be confirmed.&lt;/u&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;u&gt;Graduation&amp;nbsp;Cords&amp;nbsp;will distributed during SENIOR SHOWCASE and then will be available for pick-up at the CAHSI Student Resource Center located on the 4th floor of GLAB starting April 26th until May 12th.&amp;nbsp;&lt;/u&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/FP412VbJzUiGS4EX7&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;&lt;strong&gt;COMPLETE FORM HERE SENIORS&amp;nbsp;&lt;/strong&gt;&lt;/a&gt; &lt;em style=&quot;color: rgb(230, 0, 0);&quot;&gt;&lt;u&gt;(FORM MUST BE COMPLETED IN ORDER TO GET GRADUATION CORDS!) &lt;/u&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;',0,0,761),(9,'2023-05-02 21:23:55',14,'THIS WEEK:Tons of internship and opportunities for CS/IT Students','&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(230, 0, 0);&quot; class=&quot;ql-size-large&quot;&gt;Heads up, there&#039;s a lot of text in this email &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(230, 0, 0);&quot; class=&quot;ql-size-huge&quot;&gt;BUT &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(230, 0, 0);&quot; class=&quot;ql-size-large&quot;&gt;it&#039;s totally worth it! Tons of internship, employment and opportunities, including a cybersecurity conference here at Kean! &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;Upcoming Events&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;May 5th - Say Hello to the World of Machine Learning (CAHSI Workshop) - See attached Flyer&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;Featured Opportunity &lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=&quot;https://www.njohsp.gov/careers#op-572906-2309s-cybersecurity-analyst-i-intelligence-analyst-apprentice&quot; target=&quot;_blank&quot; style=&quot;color: rgb(26, 26, 26);&quot;&gt;23-09-S Cybersecurity Analyst I (Intelligence Analyst Apprentice)&lt;/a&gt; | Location: Hamilton, West Trenton,or Newark New Jersey |&amp;nbsp;Full-time | Partially remote&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://www.njohsp.gov/careers#op-573092-2310s-governors-fellow&quot; target=&quot;_blank&quot; style=&quot;color: rgb(26, 26, 26);&quot;&gt;23-10-S Governor&#039;s Fellow&lt;/a&gt; | Location: Hamilton Township, New Jersey, United States |&amp;nbsp;Full-time | Partially remote &lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;***GRADUATE STUDENTS ONLY*** &lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;Featured Companies&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=&quot;https://www.themuse.com/profiles/humana?sc_src=email_3620185&amp;amp;sc_lid=367598945&amp;amp;sc_uid=tuer3ETPq2&amp;amp;sc_llid=897&amp;amp;sc_eh=8cb28921377e7e8a1&amp;amp;utm_source=emarsys&amp;amp;utm_medium=email&amp;amp;utm_campaign=dedicated_20230428_humana_targeted_90Day_3620185&amp;amp;utm_content=Dedicated&amp;amp;utm_term=Company+Profiles_&amp;amp;uid=707885099#jobs&quot; target=&quot;_blank&quot;&gt;Humana &lt;/a&gt; &amp;amp; Educational Testing Service (ETS) - &lt;a href=&quot;https://etscareers.pereless.com/83080/talent.cfm&quot; target=&quot;_blank&quot;&gt;Employment&lt;/a&gt; | &lt;a href=&quot;https://www.ets.org/research/internship-fellowship/about.html&quot; target=&quot;_blank&quot;&gt;Internships&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;Featured Articles &lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=&quot;https://www.themuse.com/advice/entry-level-tech-jobs-careers-list?utm_source=sendgrid&amp;amp;utm_medium=email&amp;amp;utm_campaign=daily_20230501_sg_2_90Day&amp;amp;utm_content=newsletter&quot; target=&quot;_blank&quot;&gt;8 Entry-Level Roles to Break Into Tech—No Matter What Your Background Is&lt;/a&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://www.themuse.com/advice/fill-in-the-blank-resume-worksheet?sc_src=email_3487788&amp;amp;sc_lid=351157149&amp;amp;sc_uid=tuer3ETPq2&amp;amp;sc_llid=71509&amp;amp;sc_eh=8cb28921377e7e8a1&amp;amp;utm_source=emarsys&amp;amp;utm_medium=email&amp;amp;utm_campaign=daily_20230322_NoSpon_90Day_3487788&amp;amp;utm_content=sponsored&amp;amp;utm_term=Advice+-+Finding+a+Job_&amp;amp;uid=707885099&quot; target=&quot;_blank&quot;&gt;This Free Worksheet Makes It Easy to Create (or Update) Your Resume&lt;/a&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://www.themuse.com/advice/185-powerful-verbs-that-will-make-your-resume-awesome?sc_src=email_3465128&amp;amp;sc_lid=347900315&amp;amp;sc_uid=tuer3ETPq2&amp;amp;sc_llid=18643&amp;amp;sc_eh=8cb28921377e7e8a1&amp;amp;utm_source=emarsys&amp;amp;utm_medium=email&amp;amp;utm_campaign=daily_20230315_NoSpon_90Day_3465128&amp;amp;utm_content=sponsored&amp;amp;utm_term=Advice+-+Finding+a+Job_&amp;amp;uid=707885099&quot; target=&quot;_blank&quot;&gt;185+ Action Verbs That Will Majorly Impress Hiring Managers&lt;/a&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://www.themuse.com/advice/managing-inbox-tips-real-people-get-hundreds-emails?sc_src=email_3465128&amp;amp;sc_lid=347900311&amp;amp;sc_uid=tuer3ETPq2&amp;amp;sc_llid=18643&amp;amp;sc_eh=8cb28921377e7e8a1&amp;amp;utm_source=emarsys&amp;amp;utm_medium=email&amp;amp;utm_campaign=daily_20230315_NoSpon_90Day_3465128&amp;amp;utm_content=sponsored&amp;amp;utm_term=Advice_&amp;amp;uid=707885099&quot; target=&quot;_blank&quot;&gt;10 Ways to Manage Your Email Inbox—According to People Who Get 100+ Emails a Day&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span class=&quot;ql-size-large&quot;&gt;Important Information (Total of 9)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;1) SECON NJ 2023 Cybersecurity Conference - &lt;/strong&gt;&lt;a href=&quot;https://www.eventbrite.com/organizations/missive/activity/redirect/?p=ABIdvVsOnR5oyS9wWGordFIAhh2WZosKweaWHGy-h57uXJ7-NY6Bb51EF9VDNDZI8Iw6unVGGfgINm3yFJB38-qhCHkRfbWtDa2x4-OkyYF0dZWdkfhc8Korxq9XjwlQ_ZGhbBGPOlGmDJI6IwBk7DnGhfnhIjqZDrff6KtjCqPW5Ssw24aaKBFXNqZCMNcX9LgjcGxD7F0iVIw2fRHBhWpXvvQqDj8ACn79f0bH52QKOtMuqa_l_xsys_4GxxJWz4g2aN6VPJ7BoJS7eBms7Y99Rs89lyc30QxTdD_b43NbTA9Zw4lM86-BPWU3Q8gABwb3p_XTcl7SRpB6l0QNiRzLINck_bscPG6sxf_3ruQXz-drN5LkhrhP3n22ad3UowEUAL6b27_5OU5kNZnQ4unsoUZbXtn4vPwCxie2DRJhkpoXVgn6V2PZkOLd8EmYfle4ikm3ifSbZAxn96pan9l6XNUMgRsEjCiUNY9-1Lb61NtslYJfUBSBTRZALolLEP3VLmLBpbyQvHtMRjJLkjs8xWktaVgPG8U2iveUWOVoROtQ7d2xfhk&amp;amp;eid=556584648667&amp;amp;c=15701319&amp;amp;co=57802650&amp;amp;t=e&quot; target=&quot;_blank&quot; class=&quot;ql-size-large&quot;&gt;&lt;strong&gt;REGISTER HERE &lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This year several key benefits will be made available to students, including:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;1. Ability to have a professional photo taken and given to you for potential use in LinkedIn profiles, for example.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;2. Ability to have a resume reviewed by cybersecurity, security, and information technology professionals.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;3. Ability to attend Kean student presentations.&lt;/p&gt;&lt;p&gt;4. Breakfast, lunch, and snacks will be provided throughout the day.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;2) Last Call for Graduation Cords &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(0, 0, 0);&quot;&gt;It&#039;s that time!&lt;/strong&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp;Time for Graduation Cords! All graduating CS/IT students will receive (1) cord for graduation.&amp;nbsp;IF you participated&amp;nbsp;in&amp;nbsp;any other CS/IT student opportunity,&amp;nbsp;you may be eligible for another cord for your participation.&amp;nbsp;&lt;/span&gt;&lt;u style=&quot;color: rgb(0, 0, 0);&quot;&gt;Please note, all additional participation will need to be confirmed.&lt;/u&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;u&gt;Graduation Cords will be available for pick-up at the CAHSI Student Resource Center located on the 4th floor of GLAB until &lt;/u&gt;&lt;/strong&gt;&lt;strong style=&quot;color: rgb(230, 0, 0);&quot;&gt;&lt;u&gt;May 12th.&amp;nbsp;&lt;/u&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://forms.gle/FP412VbJzUiGS4EX7&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;&lt;strong&gt;COMPLETE FORM HERE SENIORS&amp;nbsp;&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;3) Join our LinkedIn Group..we sent like 5 opportunities out today!&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;em&gt;Did you know the department has been sharing with students weekly internship and employment opportunities?&amp;nbsp;&lt;/em&gt;&lt;u&gt;Yup! On HANDSHAKE &amp;amp;&amp;nbsp;LinkedIN!&amp;nbsp;&lt;/u&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Make sure you sign into Handshake using your Kean email address to access your account; and complete your profile to begin to connect with thousands of employers. For all of you who are looking for a job or internship, don&#039;t wait and get started today!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Don&#039;t forget&amp;nbsp;to join our Department&#039;s&amp;nbsp;LinkedIn&amp;nbsp;group, our&amp;nbsp;online community for current students,&amp;nbsp;alumni and faculty/staff can connect and share resources/opportunities!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://app.joinhandshake.com/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;&lt;strong&gt;Log Into Your Handshake Account&amp;nbsp;Today!&amp;nbsp;&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.linkedin.com/groups/13598376/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204);&quot;&gt;&lt;strong&gt;Join our&amp;nbsp;LinkedIn&amp;nbsp;Group&amp;nbsp;&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot; style=&quot;color: rgb(34, 34, 34);&quot;&gt;4) 2023-2024 Governor’s STEM Scholars - Research focused &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(33, 33, 33);&quot;&gt;To be Eligible:&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;Applicants must be a sophomore in high school through doctoral level as of Fall 2023; be enrolled in a New Jersey high school, college or university, or a certified as a home-schooled student in New Jersey; have a 3.5 cumulative GPA or higher; and show a strong commitment to STEM in New Jersey.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: black;&quot;&gt;Interested in learning more?:&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: black;&quot;&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;Join the Governor’s STEM Scholars for a virtual&amp;nbsp;&lt;/span&gt;&lt;strong style=&quot;color: black;&quot;&gt;&lt;em&gt;Governor’s STEM Scholars Open Applicant Information Session&amp;nbsp;&lt;/em&gt;&lt;/strong&gt;&lt;span style=&quot;color: black;&quot;&gt;to learn more about the program and the application process. Open calls will be held on March 15, April 4,&amp;nbsp;&lt;/span&gt;&lt;strong style=&quot;color: black;&quot;&gt;April 27 (college applicants only)&lt;/strong&gt;&lt;span style=&quot;color: black;&quot;&gt;, &lt;/span&gt;&lt;span style=&quot;color: black; background-color: rgb(255, 255, 0);&quot;&gt;May 16, and June 1.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;Check out&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://www.govstemscholars.com/apply&quot; target=&quot;_blank&quot; style=&quot;color: rgb(33, 33, 33);&quot;&gt;www.govstemscholars.com/apply&lt;/a&gt;&lt;span style=&quot;color: black;&quot;&gt;&amp;nbsp;for times and registration information.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: black;&quot;&gt;**Please scroll down to find registration information on the website**&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;5) INROADS (Internship Opportunities) *&lt;/strong&gt;&lt;strong class=&quot;ql-size-large&quot; style=&quot;color: rgb(230, 0, 0);&quot;&gt;&lt;em&gt; We have placed over 15 students with INROADS, are you next? &lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;span style=&quot;color: rgb(32, 33, 36);&quot;&gt;For students to be eligible for INROADS, they must meet the qualifications below:&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Be a full-time undergraduate college student with at least 1 summer or 27 credit hours&amp;nbsp;remaining&amp;nbsp;before graduating college&amp;nbsp;&lt;/li&gt;&lt;li&gt;Have a Cumulative Grade Point Average (GPA) of 2.8 or higher, and&amp;nbsp;&amp;nbsp;&lt;/li&gt;&lt;li&gt;Major in Business, STEM, or Liberal Arts&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 112, 192);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Below are a few companies&amp;nbsp;where&amp;nbsp;our interns have been placed:&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;L3 HARRIS&amp;nbsp;&lt;/li&gt;&lt;li&gt;HORIZON BLUE CROSS&amp;nbsp;&lt;/li&gt;&lt;li&gt;LOUIS&amp;nbsp;VUITTON&amp;nbsp;MOET HENNESSY&amp;nbsp;&lt;/li&gt;&lt;li&gt;ANTERIX&amp;nbsp;&lt;/li&gt;&lt;li&gt;PFIZER&amp;nbsp;&lt;/li&gt;&lt;li&gt;SANOFI&amp;nbsp;&lt;span style=&quot;color: rgb(255, 0, 0);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Candidates can apply to INROADS&amp;nbsp;via our&amp;nbsp;website&lt;span style=&quot;color: rgb(255, 0, 0);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://www.inroads.org/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);&quot;&gt;www.inroads.org/APPLY&lt;/a&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot; style=&quot;color: rgb(31, 31, 31);&quot;&gt;6) Share your resume with these (hiring!) companies&lt;/strong&gt; ( Women focused opportunity) &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Are you on the lookout for your next career leap? Want to grow your career at a company that will support you at every step of the way? We&#039;ve got you covered!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;FairyGodBoss has partnered with 11&amp;nbsp;great companies that have a track record of supporting women like you in their career journeys. Even better — they&#039;re actively recruiting for a wide range of roles and professional levels!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;http://link.info.fairygodboss.com/ls/click?upn=zuCgYbZELxzq8afYLOZwWj-2F4VNIJIvFGXQlgwoNDnezapPrJDUIhse1WxXua2EqUYzrGPYMXFpvmJHVa3wqfkU2og92TtRQKvISZawaLp1vRD1Dg-2B3rP8EthNHhIMcLg2cuTp2770wABG0ddxqA7Wg6Lgt-2FKEHcUigkH4IzjBlg-3DBzMQ_bow2xKHuQzDd2JTVhaC8AYzekHG3CXrrjJWacHN-2BzEDXIhglkM9quAd1b-2BN5Opj5JWXxjeLNZw0-2BzUWN7wmJuB9nKx