-2BOj4HQDFbPb-2FkjatLfbkg7f8ZZbQLaJ5xSk-3D&quot; target=&quot;_blank&quot;&gt; Terminix&lt;/a&gt; | &lt;a href=&quot;http://link.info.fairygodboss.com/ls/click?upn=zuCgYbZELxzq8afYLOZwWj-2F4VNIJIvFGXQlgwoNDnezapPrJDUIhse1WxXua2EqUY6qE2BA-2BnPBkdimBRfoGQYw1JSfBks6CbzKCcQzVVu8xt6BTUNfwqh2Cqcz6kqqtTdFCLzSUz14pKIHIJVbTjqs8cNL9txjDndvjj85KKyk-3DoHE-_bow2xKHuQzDd2JTVhaC8AYzekHG3CXrrjJWacHN-2BzEDXIhglkM9quAd1b-2BN5Opj5JWXxjeLNZw0-2BzUWN7wmJuB9nKx9ZXwPFM-2B-2FImrRE-2FzDDQswyypcR7OEYHBHw7d7OI04narYoeykYz-2F01DjTebSJcbYw8MOU4QKGXuIRqaZ-2BjHR4sXZZaze3KvWzaqtnnJ33pZWx6T4TkoufSPhJHGW23RWea4OfhWv-2FCt06NQm9kkH5d96S1TxJFhYj8T8N5eyeZo89-2FD5jYyEM-2FR-2FuHCMhDBMADXTl2Y7QUXniBFUNkugex5NtQ8jiyZweYdItjUxmi7GniC8R8Et-2FPQqsV7LYDT6JD605vKw20UqFd7O65UZ7RD3Z6W-2BQA68iLDNU1k4VuM0XVusOnkxWKlu2CgCSOS6Q0se-2B4sf-2FXcSZ66Stp2uHdLkGGurkt6IaREbhHkMVodwI-2FqyNEkhN-2FWSk-2BsyiCT-2FSmyy3cxtZ50Fkrjqc-3D&quot; target=&quot;_blank&quot;&gt;WWE &lt;/a&gt; &lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;If you&#039;d like to take the next step in your career journey, all you have to do is click the following button and share your resume by Friday, May 26th. These companies are excited to meet you!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://fairygodboss.typeform.com/resume-drop?utm_source=sendgrid&amp;amp;utm_medium=email&amp;amp;utm_campaign=dedicated04.28.23&quot; target=&quot;_blank&quot;&gt;Join The Resume Drop today!&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;7) Tapia Resume Database&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Did you know, that you do not have to attend the Tapia Conference to submit a resume? &lt;a href=&quot;https://tapiaconference.cmd-it.org/submit-resume/&quot; target=&quot;_blank&quot;&gt;Submit you resumes&lt;/a&gt; on the Tapia Resume Database to have top employers review your resume. &lt;strong style=&quot;color: rgb(230, 0, 0);&quot;&gt; Just be sure to indicate such on the submission form.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;8) Summer Internships Opportunities via NJ Career Accelerator Grant Program&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(34, 34, 34);&quot;&gt;Over&lt;/span&gt;&lt;strong style=&quot;color: rgb(34, 34, 34);&quot;&gt; 125 employers&lt;/strong&gt;&lt;span style=&quot;color: rgb(34, 34, 34);&quot;&gt;&amp;nbsp;seeking over&amp;nbsp;&lt;/span&gt;&lt;strong style=&quot;color: rgb(34, 34, 34);&quot;&gt;500 interns&amp;nbsp;&lt;/strong&gt;&lt;span style=&quot;color: rgb(34, 34, 34);&quot;&gt;across the state. The booklet is broken down by&lt;/span&gt;&lt;strong style=&quot;color: rgb(34, 34, 34);&quot;&gt;&amp;nbsp;industry&lt;/strong&gt;&lt;span style=&quot;color: rgb(34, 34, 34);&quot;&gt;&amp;nbsp;but some roles cross industries.&lt;/span&gt; - &lt;a href=&quot;https://www.state.nj.us/highereducation/documents/pdf/NJ%20CAIGP%20Opportunities%20by%20industry.pdf&quot; target=&quot;_blank&quot;&gt;Explore the list here! &lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;9) Girls Who Code Opportunities  &lt;/strong&gt; ( Women focused opportunity) &lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;&amp;nbsp;Build your leadership skills:&lt;/strong&gt;&amp;nbsp;Join our Leadership Academy, a four-month-long program for rising third and fourth-year students to come together to learn in small cohorts, participate in programs, grow networks, and complete a capstone project. This program offers a stipend to all participants.&amp;nbsp;&amp;nbsp;&lt;a href=&quot;https://girlswhocode.cmail20.com/t/d-l-zutiuht-jildkdjtll-d/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(38, 155, 144);&quot;&gt;Apply today&lt;/a&gt;!&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Prepping for a Technical Interview?&amp;nbsp;&lt;/strong&gt;Participate in the GWC Technical Interview Prep program this Spring! Sign up for our free online Forage course&amp;nbsp;&lt;a href=&quot;https://girlswhocode.cmail20.com/t/d-l-zutiuht-jildkdjtll-h/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(38, 155, 144);&quot;&gt;here&lt;/a&gt;&amp;nbsp;to practice different types of technical interviews on your own time.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Join Our Alumni Focus Group:&amp;nbsp;&lt;/strong&gt;Girls Who Code is launching a new research initiative focusing on our alumni’s early career experiences in the tech space, and we want to hear from you. Apply&amp;nbsp;&lt;a href=&quot;https://girlswhocode.cmail20.com/t/d-l-zutiuht-jildkdjtll-k/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(38, 155, 144);&quot;&gt;here&amp;nbsp;&lt;/a&gt;to join our Alumni Focus group this summer. Selected participants will also receive a $50 Amazon gift card.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;&lt;em&gt;That&#039;s all for now! Best of luck and apply!!!!!&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;',0,0,761),(10,'2023-05-04 15:21:40',14,'[CLOSING MONDAY] GMIS Kean Scholar Application Due by midnight!','&lt;p&gt;&lt;strong class=&quot;ql-size-large&quot;&gt;Last chance to apply to be a Kean Scholar!&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;As a Kean Scholar, you will have the opportunity to attend the &lt;span style=&quot;color: rgb(32, 33, 36);&quot;&gt;Great Minds in STEM  Conference (&lt;/span&gt;GMIS) this fall to network with industry professional and grow professionally.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This year the conference will be hosted in Pasadena, California from October 11th - 14th. &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;span style=&quot;color: rgb(32, 33, 36);&quot;&gt;Great Minds in STEM is a great opportunity to meet students on the same path as you. &lt;/span&gt;&lt;/li&gt;&lt;li&gt;Network with top employers such as Lockheed Martin, Northrop Grumman, Google and more!&lt;/li&gt;&lt;li&gt;Connect with other CAHSI schools for opportunities&amp;nbsp;in research, graduate school, and even Ph.D. schools. &lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;color: rgb(230, 0, 0);&quot;&gt;All this and much more......best part it&#039;s FREE!!!!&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;em style=&quot;color: rgb(32, 33, 36);&quot;&gt;&lt;u&gt;There is limited space , so don&#039;t wait. &lt;/u&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://docs.google.com/forms/d/e/1FAIpQLSd8mRfbjY3sPp26PXi5tjR5SVlN4twS6yoozdbBhxSksL8y8g/viewform&quot; target=&quot;_blank&quot; class=&quot;ql-size-large&quot;&gt;&lt;strong&gt;APPLY NOW &lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;',0,0,761);
